The most common way of filtering columns is to compare them. Endb provides =, >, <, >=, <= operators. These work on all column types, though comparing two disparate types may produce unexpected results. SELECT * FROM products WHERE product_no = 99;
SELECT * FROM products WHERE price < 4;
SELECT * FROM products WHERE name >= 'Cabin';

