The WITH keyword is used to create Common Table Expressions , or CTEs. CTEs act like temporary tables or views within the context of a query. CTEs are used in place of a sub-select to simplify the appearance of a query. WITH clauses take the form WITH <cte-name> AS (<cte-select>). WITH top_margin_products AS (SELECT product_no FROM products WHERE (price - cost) > 5.00)
SELECT name FROM products
WHERE product_no IN (SELECT product_no FROM top_margin_products);

43.body:
The RECURSIVE keyword can be added to WITH to create recursive CTEs which can refer to themselves. Recursive CTEs will always have the form <initial-select> UNION <recursive-select> or <initial-select> UNION ALL <recursive-select>. Here is a naive example, demonstrating the recursive construction of a Fibonacci Sequence: WITH RECURSIVE fib(previous, current) AS ( VALUES (0, 1) UNION ALL SELECT fib.current, fib.previous + fib.current FROM fib WHERE fib.previous + fib.current < 5000
)
SELECT * FROM fib; The most beneficial uses for WITH RECURSIVE are walking hierarchical and graph-shaped data sets -- capabilities ordinary SQL lacks. However, Endb recursive queries are also capable of solving Sudoku puzzles and constructing fractals, as seen in the test suite . (Credit goes to SQLite's delightful Outlandish Recursive Query Examples .)

