LIKE returns true if a string matches the supplied LIKE pattern, as defined below: A pattern can be a string literal. It can also contain underscores (_) and/or percentage symbols (%). An underscore matches exactly one character. A percentage symbol matches zero or more characters. Backslash escapes the following character to make it a literal. SELECT * FROM products WHERE name LIKE 'Tofu';
SELECT * FROM products WHERE name LIKE 'Tof_';
SELECT * FROM products WHERE name LIKE '%of%';
SELECT * FROM products WHERE name LIKE '\%of\%'; NOT LIKE is used to invert the results of the match. SELECT * FROM products WHERE name NOT LIKE '%of%'; NOTE: Endb LIKE is case-sensitive.

