The TRIM, LTRIM, and RTRIM functions trim surrounding whitespace, whitespace to the left, and whitespace to the right of a string, respectively. SELECT TRIM(' hello ');
-- 'hello'
SELECT LTRIM(' hello ');
-- 'hello '
SELECT RTRIM(' hello ');
-- ' hello'

